import Link from "next/link";

const Header = () => (
  <>
    <div className="navbar">
      <Link href="/">
        <a className="logo">WYC</a>
      </Link>
      <Link href="/">
        <a className="navlink">Home</a>
      </Link>
      <Link href="/about">
        <a className="navlink">About</a>
      </Link>
      <style jsx>
        {`
          .logo {
            display: block;
            font-family: "Arial";
            text-decoration: none;
          }

          .navlink {
            display: inline;
            float: right;
            font-family: "Arial";
            margin-right: 15px;
            text-decoration: none;
          }

          .navlink:hover {
            opacity: 0.6;
          }
        `}
      </style>
    </div>
  </>
);

export default Header;
